import React from 'react'; 
import './App.css';
// Components:
import LoginForm from "./containers/loginForm";
import { Header } from 'semantic-ui-react'


function App() {
   return (
      <div className="ui container">
         <Header as='h1' block>
            Welcome to MyTTF
         </Header>

         <LoginForm/>
      </div>
   );
}

export default App;
